import 'package:ieca_mobile/_import.dart';

class KwHymnsGeneral {
  static List<HymnsContent> list = [
    HymnsContent(id: 5200, position: 1, content: "Otu li moipafi\nYakalunga ketu.\nHano natu weni pedu,\nFye tu mu twil’eengolo\nNoku mu fimaneka\nShili, twe lifyoonopeka.\nMu shiiveni, Mu tangeni,\nYe Kalunga ketu,\nYe Omushiti wetu.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_1, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5201, position: 2, content: "Ovakerubi mwi,\nOmunaapesh’ akushe,\nTave mu twil’ eengol’ alushe.\nNovaengeli yo\nHava imbi aveshe:\n“Muyapuki” efimbo keshe.\nT’uda yo, Hokwa yo\nOkayambo ketu\nOkokwiimba kwetu.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_1, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5202, position: 3, content: "Tate, otwe uya\nKoshipala shoye\nOkuud’ eendjovo doye.\nTu pOmhepo yoye,\nMuminikili wetu,\nYelel’ omitima detu.\nKomba mo, Xwiba mo\nOmaukulu etu\nNomahalo etu.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_1, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5203, position: 4, content: "Mwene, il’ u kale\nMomitima detu,\nPangel’ okukala kwetu.\nIla u tu longe\nOnOmhepo yoye,\nOkukal’ovana voye.\nNosho yo Apa yo\nTu li tu ku tale,\nPwoove fye tu kale.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_1, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5204, position: 1, content: "Imbeni, ne aayengeli,\nMu tange Jesus, ee.\nMu mu lenge ngu omusimani,\nA ninge Omukwaniilwa,\nJesus Omuwa ngu.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_2, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5205, position: 2, content: "Omuhokololambinzi gwe\nKwa li e um kondjele,\nE mu tilile ombinzi ye,\nNa ninge Jesus Omuwa,\nOmukwaniilwa gwe.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_2, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5206, position: 3, content: "Megulu aayapuki mbo Naaye,\nye mu imbile.\nYe mu kundithe iiyale wo,\nYa tange Omuwa Jesus,\nOmukwaniilwa ngo.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_2, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5207, position: 4, content: "Ombepo nayi hwameke\nOmulilo mutse wo.\nOndjimbo tu yi mu imbile,\nNgu Jesus, Omukwaniilwa,\nYe na simane!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_2, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5208, position: 5, content: "Tu kwatela mongundu ndjo\nTaa tanga Omuwa mpe.\nMelago tse tu mu imbile:\nOngoye Jesus, taamba\nHambelelo ndi.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_2, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5209, position: 1, content: "Vaitavel’ileni,\nKaluken’akushe,\nTu lotokeleni Ku Betlehem.\nTu ye kOkaana, Mweetilao\nlaalushe!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_3, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5210, content: "Natu mu twilen’eengolo,\nNatu mu twilen’eengolo,\nNatu mu twilen’eengolo,\n‘Ohamba!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_3, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5211, position: 2, content: "Ohamba yefimano\nShime shoukwaalushe,\nE liukatekifa ku Maria,\nNande okalunga e uya\nkufyen’ atushe.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_3, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5212, position: 3, content: "Tu pandekelen’\nOmwen´ eimbilo letu,\nNovaengeli tu tye:\nEfimano LaXe\nMuelu, mokombanda yedu!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_3, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5213, position: 4, content: "O, Jesus, Ondjovo,\nWe tu dalelw´ atushe\nWa ning´ ombelela, twa\nkulilwa,\nHambelelwa ndee fimanekw’\nalushe!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_3, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5214, position: 1, content: "Nyakukweni, nye Hafeleni\nnee Fiku eli laKrismesa!\nJesus a dalwa, Twa li twa kana.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_4, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5215, content: "Hafa, hafa, mukriste yakukwa!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_4, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5216, position: 2, content: "Nyakukweni, nye Hafeleni\nnee Fiku eli laKrismesa!\nKristus e uya, Mupopil’ e uya:", hymnsNumber: KwHymnsNumberSeeder.GENERAL_4, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5217, position: 3, content: "Nyakukweni, nye Hafeleni\nnee Fiku eli laKrismesa\nUlu ove, mu yamba, Imbila Himba!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_4, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5218, position: 1, content: "Oufiku uyapuki,\nAveshe va Kofa.\nMaria na Josef aveke,\nVa diinina okaana Kavo\nAka ke li nawa,\nAka ke li nawa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_5, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5219, position: 2, content: "Oufiku uyapuki,\nVafita va uda\nKovaengeli “Halleluja”\nEshi sha udika Kombada,\nOmukwafi e uya,\nOmukwafi e uya.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_5, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5220, position: 3, content: "Oufiku uyapuki,\nKalunga nOmona\nOhole yaye twe i mona,\nOve we uya oku tu kulila\nKristus medalo loye,\nKristus medalo loye.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_5, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5221, position: 1, content: "Aanene naashona amulhe, mu ye\nKuBetlehem otse atuhe tu ye,\nElago enene lya ningilwa mo,\nKalunga ngu Tat’e li tumine ko.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_6, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5222, position: 2, content: "Taleni mu tale metemba olye.\nO Jesus omunona oshili oye,\nLleni mu kunde, kanona tuu nka,\nKa zile megulu, kutseni ke ya", hymnsNumber: KwHymnsNumberSeeder.GENERAL_6, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5223, position: 3, content: "Tu tseni oongolo, tu um simaneke,\nOngaashi aasita tu mu hambelele,\nEpopilo lyetu lyehambelelo\nKu Tate megulu li uvike wo.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_6, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5224, position: 4, content: "Otwe ya kungoye, Omumangululi,\nTwa hala u taambe oomwenyo wo ndhi,\nTu sila ohenda, tu opaleka wo,\nTu ninge aayuuki nangoye ngu wo.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_6, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5225, position: 1, content: "Kalung’ ohole, a xupifa nge,\nKalung’ ohole, e, hole nge.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5226, content: "Onghee hai mu imbile\nKalung’ ohole,\nKalung’ ohole,\nE hole nge.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5227, position: 2, content: "Nda li nda Kwatwa Koulunde wange,\nMatimba ange a manga nge.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5228, position: 3, content: "Konyalanyala nda fililila.\nOnda ndja mefyo, nda xupifwa", hymnsNumber: KwHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5229, position: 4, content: "Nohanga nda mekaneneno,\nNdee onda twalwa mexupifo.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5230, position: 5, content: "Kawe uya Jesus, a kulila nge,\nKalung’ e mu tuma, a fila.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5231, position: 6, content: "Nda li omupika womutondi wange,\nNda mangululva, a fila nge.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5232, position: 7, content: "Eendjovo daye a tumina nge,\nOmo ndi mu hange ,a fila nge.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5233, position: 8, content: "Eendjovo daye oikulya yange,\nMondajila yaye da tula nge.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5234, position: 9, content: "Ohole yaye omwenyo wange,\nNohole yaye a konga nge.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5235, position: 10, content: "Ohole yaye tai velula nge\nTai pupaleke,  tai pameke.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5236, position: 11, content: "Ohole yoye, Kalunga Kange,\nInenene wa Kwafa nge.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5237, position: 12, content: "Meulu loye to fikifa nge,\nNdi kale pwoove alushe nee.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5238, position: 13, content: "Onghee nda hala ndi hambelele\nKalunga e hole nge.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5239, position: 1, content: "Pe ng’ eendjovo doye, Mwene\nMona kali xulu po\nNola fimana unene.\nNdi li nonda wana po.\nNgenge ha eendjovo doye,\nPeni pa dj’ eitavelo?\nShamha ndi n´emona loye,\nKoyounyuni nghi na ko.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_8, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5240, position: 2, content: "Halleluja! Osho shili,\nEendjamwenyo we tu pa.\nMwene eendjovo doy’dombili\nMeni letu kaleka.\nHokwifa ng’eendjovo doye,\nKwafa, ndi ku longele,\nNdi há dje peemhadi doye,\nNgaashi Maria yo nee.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_8, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5241, position: 1, content: "Hosianna Jesus Kristus,\nNa hambelelwe ngu,\nOmuna gwa David oonguka,\nTe ya medhina lyOmuwa!\nHosianna Jesus Kristus,\nNa hambelelwe ngu,\nOmuna gwa David oonguka,\nTe ya medhina lyOmuwa!\nHosianna mokombanda,\nHosianna, Hosiana,\nOmuna gwa David oonguka,\nTe ya medhina lyOmuwa!\nHosianna mokombanda,\nHosianna, Hosianna,\nOmuna gwa David oonguka\nTe ya medhina lyOmuwa!\nHosiana Jesus Kristus,\nNa hambelewe ngu,\nOmuna gwa David oonguka,\nTe ya medhina lyOmuwa!\nHosianna mokombanda,\nHosianna, Hosianna,\nOmuna gwa David oonguka,\nTe ya medhina lyOmuwa!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_9, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5242, position: 1, content: "Ndi tshwaneke ngiini\nOngoye, Nakuya?\nEnyanyu enene ngiini\nUuyuni we u pa!\nO Jesus Kristus mwene,\nOondunge yelitha,\nNangame ndi ku kunde\nPamukalo ngo gwa tsa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_10, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5243, position: 2, content: "MuSion we ya nale,\nWa li gwesimano.\nWa yalelwa iiyale\nMpoka wa ende po.\nOsho nangame nguka\nOtii ku pandula\nNeimbilo tuu ndika\nLyesimaneko mpa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_10, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5244, position: 3, content: "Wa gwanitha ayihe\nNopeha lyandje wo.\nNda manguluka ihe\nMeti liyekaneno.\nKanda li ndi n’ombili,\nNenyanyu ndaa li na.\nOngoye w’eta shili\nShoka nda yuulukwa", hymnsNumber: KwHymnsNumberSeeder.GENERAL_10, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5245, position: 4, content: "Osho ohole yoye\nOnene u yi na.\nOmwenyo gwoye mwene\nWa gandj’iikulila.\nOsheelo shomegulu\nOwe egulula,\nMuupika mbu uululu\nSho we tu hupitha.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_10, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5246, position: 5, content: "Einekelo lyetu\nMu Jesus li li mo.\nE ya moomwenyo dhetu.\nMuumbanda twa zi mo,\nMbo we tu limbilike\nNowe tu thindile\nMehepeko alihe\nMoka twa kalele", hymnsNumber: KwHymnsNumberSeeder.GENERAL_10, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5247, position: 6, content: "Kepangulo nge te ya\nOye naayengeli,\nKungame wo ote ya\nOye omupanguli.\nTa pengula aadhini,\nTa pe ndj’ehupitho.\nNaamboka yomahodhi\nTe ya p’efudhitho.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_10, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5248, position: 1, content: "Natu yandeni aahindi.\nTate te te tu enditha.\nLwokegumbo tatu thindi.\nJesus te tu thikitha.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_11, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5249, content: "Ngoshikungul´oshinene\nEwi lyetu tali ndunduma\nMokuhamebelela Jesus,\nNgoka e tu kulila.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_11, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5250, position: 2, content: "Kaku na uusiku nkuka,\nNomahodhi kage ko.\nUuv’uululu kau po mpoka,\nShk’uulunde wo kau po", hymnsNumber: KwHymnsNumberSeeder.GENERAL_11, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5251, position: 3, content: "Koondjo noluhodhi muka\nNuuvu wo hau alula,\nNdee oondjenda nge kuka,\nJesus te tu nyanyudha.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_11, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5252, position: 4, content: "Kwatha, Jesus kwaa ka kale\nNando ngo ta ningine,\nTse atuhe tu ku tale\nKeembo nkwi kuuyelele.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_11, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5253, position: 1, content: "Pendukeni, nye vakriste,\nKeshe mukriste, tonata!\nTaku ingida ondaka:\nTala, Mwene okwe uya.\nTe mu p’elao, e li landa\nOnohonde yaye pee.\nI n’ondilolela shili,\nHano, pendukeni nye!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5254, position: 2, content: "Nand’omulaulu fokofoko,\nEdu li u yadele,\nOmitima dovakriste,\nKuXe tadi lyaamene,\nOku taku di Ohamba,\nOu te uya a xupife\nOvadjuulukwi vOmwene,\nAva have mu teelele.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5255, position: 3, content: "Okangudu nye kOmwene,\nPendapala nyakukwa.\nJesus te uya okwiila\nAva e va hoolola.\nOy’e yadilil’ombili\nNote uya a xwamena.\nAva ve he na ko naye,\nOye te va tokola.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5256, position: 4, content: "Yapulil’eenghono doye Ou,\nOhambafimano, Ou a ninga\nShime shoye,\nHambaulu nedu yo.\nKalela Omwene woye,\nHeeno alushe mu shiukla.\nKal’oupafi okwe uya.\nPaife ye ta monika.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5257, position: 1, content: "Omuwa, sho nde ku tala ko,\nNkee we tu hepele,\nEmoniko enene ndyo\nOlyo lya Kwata ndje.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_13, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5258, content: "Kiilalo yoy’oyindji mbyo\nOnd’aludhwa kuyo.\nU shige ndje, ndaa dhimbwe po\nLuhepo lwoye ndo!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_13, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5259, position: 2, content: "Gestsemane, nde sh’uvu ko,\nOsho sha taamb’ihe\nOmata nga gombinzi ndjo,\nGa ndondelele ndje.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_13, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5260, position: 3, content: "Awike ngoy’, Omuholike,\nWa hepelele ndje.\nNohole yoy’ wa toola ndje.\nMungoy’ndi hupithwe.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_13, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5261, position: 4, content: "Ohole yandj’ ofupi ndji\nOnge ya talala,\nNohole yoy’onene ndjo\nYi sakalulula", hymnsNumber: KwHymnsNumberSeeder.GENERAL_13, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5262, position: 1, content: "Tse tu li po oondjendi mpa,\nAkutu, nkee twa makelwa\nKonyama yetu yene wo.\nYa nyata, omwinayi ndjo\nNgee pevi we yi shundula,\nIshewe tay’ ku pukitha.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_14, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5263, position: 2, content: "Nkee enda, tota uluma,\nOnyalo yoye mweneka,\nNgoy’ino tya: “Nda loloka,\nKathimbo ngaa ndi fudhe Mpa”.\nMatavu gendji ge li po,\nNkee kotoka, waa yulwe mpo.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_14, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5264, position: 1, content: "Jesus, ud elikano,\nIno efa nge.\nOv’ omukwafeli waaveshe,\nLla, kwafe nge!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_15, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5265, content: "Jesus, Jesus, ino efa nge\nOv’ omuhekeleki wetu,\nLl’u Kwafe nge!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_15, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5266, position: 2, content: "Koshipundi shoy’ shonghenda\nPe ng’ ombili yo,\nNdishingone, Ov’ Ependa,\nPe ng’ eitavelo.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_15, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5267, position: 3, content: "Omulwefyo loy’ alike\nHandi indile:\nVelula oivad’ aishe\nYomomwefyo nee", hymnsNumber: KwHymnsNumberSeeder.GENERAL_15, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5268, position: 4, content: "Ov’ ofifiya yomwenyo\nOv’omuholike.\nNdge ndi he ku na momwenyo,\nAm’ ohepele.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_15, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5269, position: 5, content: "Oto yandj’ ehafo shili,\nEsh’ u hole nge.\nOmumwenyo ndi n’ombili\nMwoove amuke.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_15, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5270, position: 1, content: "Edina lyoye, Mukulili,\nO Jesus, lyaa n’ondjele!\nOlya ti: Ngoy Omuhupithi,\nNohenda ho tulele", hymnsNumber: KwHymnsNumberSeeder.GENERAL_16, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5271, position: 2, content: "Olyo li na efudhitho,\nUudhigu nge wa lundu.\nOmo ndi na egwaneno\nLyoonkondo, ngee te gundu.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_16, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5272, position: 3, content: "Luhodhi tatu mwenenkwa\nKedhina ndi lyondilo.\nMeshigo lyalyo ngay’nda pwa,\nKandi na we etilo.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_16, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5273, position: 4, content: "Edhina ndi eholike\nOlyo lya nyanyudha ndje.\nAyihe ngay’ ndi kanithe,\nOlyo uuyamba wandje", hymnsNumber: KwHymnsNumberSeeder.GENERAL_16, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5274, position: 1, content: "Opomushigakano ngo,\nJesus, ndi li mpaka,\nNgoye show’ igandja wo\nOmolwetu mbaka.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_17, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5275, content: "Omuti ngu, Gwoye tuu,\nGwo omwenyo gwandji\nMuka  nomegulu wo\nGwo enyanyu lyandje.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_17, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5276, position: 2, content: "Mushigakano gwoye ngo\nNagu uvikile\nMaantu yokokule wo,\nNkene we ya sile", hymnsNumber: KwHymnsNumberSeeder.GENERAL_17, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5277, position: 1, content: "Kalunga oy’egameno\nMatati wo negonga.\nOye note tu shigi wo\nMoongoghi nomiiponga.\nOmutondi omunhindadhi,\nOye omukondjithi,\nOmugey’omudhudhu ngo,\nYe omunandjahi wo,\nMuuyuni mwaa na mukwawo.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_18, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5278, position: 2, content: "Tse katu sind’omutondadhi\nKoonkondo dhetu yene.\nTse otu na Omupopili,\nO Jesus Kristus mwene.\nOte tu kondjele\nNote tu gamene.\nOye a sindana\nNokawa nyanyagula\nOonkondo ndho dhohe.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_18, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5279, position: 3, content: "Uuyuni nando u udhe\nNdo Oosatana pombanda,\nYa Hala, ye tu mane po,\nTse katu na uumbanda.\nOmupangeli ongu,\nTa lel’uuyuni mbu,\nKwa gee, ta ndunduma,\nYe iha vulu sha,\nSho Jesus Okwe mu sindi.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_18, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5280, position: 4, content: "Oohapu dhOmuwa tu dhi\nNa, Dha Kola, kaa dhi vulu.\nOmupopili ngu tse tu um\nNa, Kalunga komengulu.\nNge taa tu yugu po\nEliko, mweyo wo,\nTse twaa na ko nasha,\nOshoka tse tu na\nUuyamba waKalunga.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_18, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5281, position: 1, content: "Laleka nuuyamba woye\nOmuwa Jesus, ngundu ndji.\nKwatha tu ka kal’aluhe,\nTu n’ombili yoy’Omuwa,\nHayi kala putse mbaka,\nNando tse tu kondjithwe.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_19, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5282, position: 2, content: "Ewi lyevangeli lyoye\nLye tu nyanyudhile mpa,\nOnkee tatu hambelele\nShoka we tu palutha\nOniikwiila yokomwenyo\nNosho we tu koleke", hymnsNumber: KwHymnsNumberSeeder.GENERAL_19, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5283, position: 3, content: "Thimbo lyetu nge lya thiki,\nU tu ile mevi ndi.\nTango ndyo nge tali toko,\nLla ngoy’ Omukulili,\nU tu fale meembo lyoye\nMeha ndyo lyaayapuki.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_19, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5284, position: 1, content: "Omilong’omugoyi na oonz’ omungoyi\nOdho ndho dha kala po,\nSho Yimwe yomoshigunda sho\nYa puka, ya kana mo\nKokulekule ya pukile\nKomusita ngo gway’ omuholike;\nKomusita ngo gway’\nOmuholike.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_20, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5285, position: 2, content: "“Omilong’ omungoyi\nnomugoyi u na;\nInadhi gwana ndho?”\nOmusita a yamukula ngaa:\nOyimwe ya kakna po.\nNda hala ndi konge kanzi nko”\nOndjila ndjo nand’ ondhigu ndjo;\nOndjila ndjo nand’ ondhigu ndjo.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_20, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5286, position: 3, content: "Omilonga a kond’ Omusita ngo\nSho a kongo kanzi nko.\nNavulwa kwe ka mono ngaa,\nKonyala tuu oka sa.\nOnkugo yako oy’ uvika,\nOkanzii omusit’a hupitha,\nOkanzi omusit’a hupitha.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_20, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5287, position: 4, content: "“Shike pola lyondundu ndjiyaka\nOlya tiliganena?”\n“Kombinzi ndjo yOmusita nga\nYa ndondele pevi mpa”.\n“Lishao mbyo yomiikaha ye?”\nOkanzi ke oye a kondjele.\nOkanzi ke oye a kandjele.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_20, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5288, position: 5, content: "Ekandanga notali uvica\nSig’ omegulu mwi,\nOshoka onzi ya monika,\nNdjo ya kana nkwi.\nAavengeli wo taa ligola:\nOmupogoli ngu i itedhulula:\nOmupogoli ngu i itedhulula,", hymnsNumber: KwHymnsNumberSeeder.GENERAL_20, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5289, position: 1, content: "Kristus omukwaalushe,\nOmunanghenda yo,\nOdjo youw’aushe,\nPe ng’eameno.\nMufilinghenda wange,\nHekeleke nge,\nKal’ohote yange,\nYambidide nge", hymnsNumber: KwHymnsNumberSeeder.GENERAL_21, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5290, position: 2, content: "Onohonde yoye\nKoshokife nge,\nOp’ ehandu love\nLi ha hange nge.\nKwafa Kaana koye,\nNdi ha dimbwe nee\nOudjuu wefyo loye\nMokufila.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_21, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5291, position: 3, content: "Nosho nee ndi kale\nNdi ku longele\nNomunhu woy’ ndi kale,\nOve ndi lipe.\nJesus, Mukwafi wange,\nHai ku imbile,\nNouwa woy’ hai tange\nFiy’ alushe nee.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_21, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5292, position: 1, content: "Omwenyo gwangje, penduka,\nKalunge koye mu imbila.\nU mu tangele ohole ye\nNohenda wo onene ye.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_22, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5293, position: 2, content: "Oohodhimwenyo a mweneke,\nMokusa sho a kutha ndje.\nMungame nota kala mo\nKohole yaa n’eyeleko.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_22, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5294, position: 3, content: "Nesiku ti ithana ndje\nMokusa koshipala she.\nNatango tuu ohole ye\nOtii yi mu hambelelele.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_22, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5295, position: 4, content: "Megulu nge a fala ndje.\nO Jesus tandi mu tangele\nOhole ye nohenda ye\nNuudhiginini uunene we.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_22, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5296, position: 1, content: "Ombili ya Jesus ongele ndi na\nMuudhigu tay’ gamene ndje.\nOmbili ndjo ye nde yi\nnyanyukilwa.\nNokuimba tu mu hambelele.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_23, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5297, content: "Onda pwa omOmuwa,\nOnda pwa, onda pwa\nomOmuwa!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_23, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5298, position: 2, content: "Osatana nando na tilithe ndje,\nNa hinde ndje nando na gee,\nO Jesus ogwandje na ngame ogwe\nOnda thetwa nombinzi ndjo ye.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_23, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5299, position: 3, content: "Oongunga adhihe a kutha ndje po\nOonguka a sile ndje wo,\nOmukulili gwandje a kutha ndhje mo\nOomonkandja dhoheli, yaloo!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_23, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5300, position: 4, content: "Omwenyo nda pewa kuKristus, ogwe\nO Jesus ndi mu nyanyunkilwe!\nKomwenyo nda hala ndi mu simaneke,\nNokuimba aluhe ndi tye:", hymnsNumber: KwHymnsNumberSeeder.GENERAL_23, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5301, position: 1, content: "Onedina Jesus enda\nApa mokupongola.\nLong’ashishe shomoweenda.\nNalo nokupandula.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_24, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5302, content: "Pandula, Nyakukwa,\nMulo owa xupifwa.\nPandula Nyakukwa,\nMulo owa xupifwa", hymnsNumber: KwHymnsNumberSeeder.GENERAL_24, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5303, position: 2, content: "Momayeleko eddina\nEli hali amene,\nOshikelelifo ndi na\nOlo hali kwafa nge", hymnsNumber: KwHymnsNumberSeeder.GENERAL_24, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5304, position: 3, content: "Pe n’ ehafo kovalunde;\nMbili olo le va pa.\nHali kufa po oulunde,\nDina li la tumbala.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_24, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5305, position: 4, content: "Hatu tang’edina eli,\nNgenge hatu fiki ko.\nOvaxupifwa ko ve li\nHave li p’epandulo.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_24, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5306, position: 1, content: "Jesus nge te enditha ndje,\nShike ngay’ndi hale we?\nOmalimbililo gaa po,\nShoka nd’uvu ohole ye.\nMwenyo gwandje gu n’ ombili,\nYe e yi tu thigile.\nOmonkatu yandje keye\nJesus mwene t’utha ndje.\nOmonkatu yandje keye\nJesus mwene t’utha ndje.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_25, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5307, position: 2, content: "Tse naye epol’alihe!\nUuweham’a kutha ndje.\nOniikwiila yokomwenyo\nTandi paluthwa kuye.\nNgele nd’uvite enota\nNenge ngay’nda loloka,\nNomeya getalaleko\nKuye tandi yambekwa;\nNomeya getalaleko\nKuye tandi yambekwa", hymnsNumber: KwHymnsNumberSeeder.GENERAL_25, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5308, position: 3, content: "Tse naye epol’alihe\nTatu yi, ta gamene.\nE n’ ohole yaa n’ ondjele,\nNgame hii yi makele,\nMoshilongo sho she mwene\nOye tuu ta fala ndje.\n“Tse naye epol’ alihe!”\nOsho tandi mu imile.\n“Tse naye epol’ alihe!”\n….Osho tandi mu imile", hymnsNumber: KwHymnsNumberSeeder.GENERAL_25, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5309, position: 1, content: "Ila ku Jesus, galuka ko,\nNgoye tuu ngo wa kanene po,\nYe Kwe ku tsil’ ondjila tuu ndjo,\nYekwe ku yuulukwa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_26, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5310, content: "Eti lyeso olya tatuka.\nJesus mwene te ku loolola.\nNkuya efudhombili lya pwa,\nNgoye to nyanyukwa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_26, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5311, position: 2, content: "Jesus a ti, naanona naa ye.\nEwi ndi lye tu nyanyukilwe.\nMwenyo ta ningi otempeli ye,\nU uvu ko? Nyanyukwa!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_26, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5312, position: 3, content: "Jesus nonena oye tuu ngo.\nYe te ku kongo, waa kale ko,\nYe ota hala, waa kane po,\nShoka wa kulilwa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_26, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5313, position: 1, content: "Omulunde, endelela,\nTo teelelwa!\nKu Jesus lotokela,\nTo teelelwa!\nEfimbo liwa onena,\nTo teelelwa.\nOkuye endelela,\nTo teelelwa", hymnsNumber: KwHymnsNumberSeeder.GENERAL_27, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5314, position: 2, content: "Omukwetu, pukuluka,\nTo teelelwa!\nNdee ove dimbulukwa,\nTo teelelwa!\nEfimbo loy’ lekongo,\nTo teelelwa.\nTo kongwa, ov’ epongo,\nTo teelelwa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_27, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5315, position: 3, content: "Omutengi we ku dunga,\nTo teelelwa,\nU eta kuKalunga,\nToteelelwa!\nKOmukukili ou woye\nTo teelelwa.\nAfil’onyanga yoye,\nTo teelelwa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_27, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5316, position: 4, content: "To ifanwa ku Jesus,\nTo teelelwa.\nKOmufilinngheda Kristus\nTo teelelwe.\nU ye kondaka yaye,\nTo teetelwa!\nU ninge omunhu waye,\nTo teelelwa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_27, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5317, position: 1, content: "Nda mangululwa konghenda yaye,\nJesus a pa nge ohonde yaye.\nKoshi yomhango a Kuulila nge,\nMetulomutim’a kufa nge.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_28, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5318, content: "Mukwetu, uda naave a fila,\nMowii dja, kOmukulili ila!\nPuye pu na emangululo,\nNote ku pe edimepo.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_28, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5319, position: 2, content: "“Shishe sha pwa”, ombedi oyetu,\nNge hatu kanif’eemwenyo detu.\n“Ila nee kwaame”, pwilikina\nKomwenyo te ku ifana!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_28, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5320, position: 3, content: "“Ovana vange”, osho Kalunga\nTe tu tu omukumo, nge hatu funga.\nTwa kufwa mefyo kOmukulili\nKeifano yoo levangeli.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_28, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5321, position: 1, content: "Jesus te ku ithana,\nKuye tse twa lombwelwa:\n“Uvithila nguyaka,\nNgoka t’ende nkwiyaka”,", hymnsNumber: KwHymnsNumberSeeder.GENERAL_29, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5322, content: "lmba, lmba nyanyukwa, Ngoye\nngu wa kulilwa, lla, endelela mpa.\nJesus te ku ithana.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_29, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5323, position: 2, content: "Ngoy´u n´oondjo, ila tuu,\nIla, Hedha kOmuwa ngu.\nNgele ngoy’ to alukwa,\nAavu wo taa aludhwa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_29, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5324, position: 3, content: "Omuti ngu gwombinzi ye\nE ku pe, u aluke.\nNale ngoy’wa pangulwa,\nNgashingey’ wa hupithwa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_29, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5325, position: 4, content: "Olye ngo ta pangula?\nOlye ngo ka kanitha?\nJesus mwene e ku na.\nIno tila nyanyukwa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_29, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5326, position: 1, content: "Mwenyo wange tambula,\nU liyapulilila.\nNomafiku ange yo Nae ku\np’epandulo.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_30, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5327, position: 2, content: "Make ange taambula,\nNokohol’a longifa.\nMhadi dange tambula.\nNdjila yoy’di lambifa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_30, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5328, position: 3, content: "Ndaka yange tambula,\nJesus, ku ku imbila,\nNomilungu tambula,\nOve yo di popifa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_30, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5329, position: 4, content: "Mona lange tambula,\nOve yo li longifa.\nNdunge dange tambula,\nNosh’ eenghono longifa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_30, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5330, position: 5, content: "Halo lange tambula,\nHalo loy’ li longifa.\nMutima wange tambula,\nNosho yo u nangala.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_30, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5331, position: 6, content: "Hole yange tambula,\nMwene wange, nde iku pa.\nAme mwene tambula.\nOnde ku liyandjela.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_30, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5332, position: 1, content: "Oufiku ou woupaani,\nOpaamha tau pu po,\nNeluwa tali tende,\nTu mon’exupifo.\nKuove hatu tale\nNoku ku indila:\nOnghenda yoy’inene,\nOmwene i tu pa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_31, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5333, position: 2, content: "KOmhepo yoy’ youladi\nTu ladipaleka,\nTu nyeke k’ovamwoye\nKomutondi satana,\nNeenghon’ adishe detu,\nTu di ku yandjele,\nOhamba ove yetu,\nFye tu ku kalele.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_31, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5334, position: 3, content: "Omwene, hambelelwa\nKufye eehepele,\nMolwaashi we tu lenga\nNonande hafye nee\nTu lyovanamadina\nIl’ovakengeli.\nMokati yoo koiwana\nHafy’ ovatimani.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_31, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5335, position: 4, content: "Shilonga shoy’ shinene,\nOmwene, we tu pa,\nTu longe tu n’ehafo\nKutandavelifa\nOuhamba woy’ akushe\nNoshinge shawo yoo,\nOpo avesheveshe\nVa mon’exupifo.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_31, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5336, position: 5, content: "Shiwana shetu konga,\nMekano sh’alula,\nShi nangeka noupuna,\nEemhunga xupifa.\nOvanhu voy’atushe,\nTu lela, pangela,\nU kal’ohamba yetu,\nOmbili pameka.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_31, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5337, position: 1, content: "Ka longe, Owa teelelwa,\nOmukriste ou wa kulilwa!\nShilonga shaye twikila,\nOndjila owa palelwa", hymnsNumber: KwHymnsNumberSeeder.GENERAL_32, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5338, position: 2, content: "Ka longe, Owa ifanwa!\nOuwa wounyuni fiya po,\nShilonga shoye: Twaalela\nVakwen’elakaxupifo", hymnsNumber: KwHymnsNumberSeeder.GENERAL_32, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5339, position: 3, content: "Ka longe! Ndee mu liyandjela\nNomwenyo u n’eduliko,\nKalunga note ke ku pa\nOndjadi ihai xulu po,", hymnsNumber: KwHymnsNumberSeeder.GENERAL_32, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5340, position: 4, content: "Ndee longa nokunyakukwa,\nU yadi elineekelo\nNefiku to ka dimbulwa\nPomuvaleki u fimane", hymnsNumber: KwHymnsNumberSeeder.GENERAL_32, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5341, position: 1, content: "Longa, uusiku tuu ya,\nLonga memeneko,\nLonga omutenya gwa tsu\nNogwa hulu po.\nLonga nge ku n’ epupyu\nLonga kwa talala.\nLonga, uusiku tuu ya,\nIto vulu sha.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_33, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5342, position: 2, content: "Manga oku n’ethimbo,\nLonga u longele\nJesus, okuume ngoka,\nE ku kulile.\nOmuwa oonkondo dhoye,\nMuyambela, mu longela.\nNge u n’omuteng’ omudhigu,\nTe ku yakula.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_33, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5343, position: 3, content: "Longa, uusiku tuu ya,\nTango lya ningine.\nLonga, ke mu longelele,\nE ku longele.\nJesus okw’et’ elago,\nSho kwe ku hupitha.\nNgoye u n’okulonga\nSigo ote ya.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_33, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5344, position: 1, content: "Jesus ndi ke mu tsakane ke,\nNdi l’iikaha yaa na sha,\nThimbo sho lya pitilile,\nNgay’inandi mu longela.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_34, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5345, content: "Jesus ndi ke mu tsakane ke\nNdi l’iikaha yaa na sha,\nNgiini tandi mu hambelele,\nSho miikaha ndaa na sha?", hymnsNumber: KwHymnsNumberSeeder.GENERAL_34, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5346, position: 2, content: "Molwiikaha mbi yowala\nOluhodhi ndi lu na\nShoka ngay’ nda mangululwa\nOnombinzi ye ya pwa", hymnsNumber: KwHymnsNumberSeeder.GENERAL_34, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5347, position: 3, content: "Mimv’ odhindji, sho dha kana,\nKadhi galukile ndje,\nNgashingey’ te galikana,\nLuhe tii ku longele.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_34, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5348, position: 4, content: "Ano, kaana kaKalunga,\nIno lala, penduka!\nLonga mbala, endelela,\nUukawaaluluhe tau ya!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_34, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5349, position: 1, content: "Ope n’edu la mana la pwa,\nTu li wete meitavelo pee!\nMu n’eenhele da longekidwa,\nTate e di tu nunina, fye", hymnsNumber: KwHymnsNumberSeeder.GENERAL_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5350, content: "Mouwa mwi, natui,\nTu ka hange oushakeneno!\nMouwa mwi natui,\nTu ka hange oushakeneno!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_35, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5351, position: 2, content: "Kwi, komunghulo wekalukilo,\nHatu pandul’ehambelelo,\nTwa pwa, tu li metulumuko,\nOmanyeme noudjuu wa pwa po.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5352, position: 3, content: "Tate, ou e tu yavelela,\nHatu mu yambe ehambelelo,\nHatu mu tang’e tu kombelela,\nNashi a kal’e tu humbata yo.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_35, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5353, position: 1, content: "Ombili onda hala, Jesus wange,\nOmbili ei ihe n’ondokosho,\nOyo tai loteke omwenyo wange\nNoupongo wange ou u xule po.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_36, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5354, position: 2, content: "Ekondji’ okulikondjela polwoye\nLixupi, noto tulumukifa.\nHo tu ng’ omukumo yo neendjovo doye\n“Ka kune, longa, ino loloka”!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_36, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5355, position: 3, content: "Odjuulufi nowike nosh’ olwoodi\nLomwenyo divadiva talu pu,\nShaashi meulu kamu n’oluhodi,\nMediva li lewaneno hai nu.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_36, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5356, position: 4, content: "Kafimbo fye tu li apa mekondjo,\nLixupi yo efimboteelelo,\nNopo nee hatu hang’ekuwililo\nOpuye, eshi fye twa fika ko.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_36, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5357, position: 1, content: "O Jesus Kristus, longa ndje,\nOngame ndi ku tangele\nEsilohenda lyoye ndi:\nWa sile ndje, Omukulili.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5358, position: 2, content: "U yogithe ndje, Mukulili,\nOmbinzi ndjo ondjapuki.\nOmwenyo ngu omuhepele\nKungoye tuu gu yeluke.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5359, position: 3, content: "Mombinzi yoy’ondjapuki\nOmu n’ekwatho, ndi li shi.\nU shi ndje, ndaa n’oonkondo we\nOmukulili, u ile ndje.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5360, position: 4, content: "Eitaalo lyandje koleka\nNoompandhi dhandje gamena,\nMondjila ndjo ondjapuki\nNdaa pukithwe kaapukithi.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5361, position: 5, content: "Muudhigu wandje ndi u na\nOngoye nde ku inekela.\nNd’itaala: ngoye nge to ya,\nKungoye tandi fudhithwa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5362, position: 6, content: "Omusita gwandje ngo wa pwa,\nOmwenyo gwandje pendutha,\nNangame wo ndi tonate,\nKungoye tuu ndi taalele.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5363, position: 7, content: "Aategeleli u ya na,\nOyendji oya kumuka.\nOolamba dhawo dhaa na sha,\nNOmbepo yoye udhitha.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_37, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5364, position: 1, content: "Egumbo ndi ewanawa\nMegulu ndi li na.\nKetungo ndyo ewanawa\nOko nda yuulukwa,\nOko nda yuulukwa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_38, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5365, position: 2, content: "Uunake moshilando shi\nOmpito ndi yi na,\nNdi kale mo pOmukulili\nAluheluhe ngaa?\nAluheluhe ngaa?", hymnsNumber: KwHymnsNumberSeeder.GENERAL_38, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5366, position: 3, content: "Kungoye tandi taalele\nNonde ku yuulukwa.\nOmukwathi gwandje,\nTaamba ndje,\nNdi kale, ngay’ nda pwa;\nNdi kale, ngay’ nda pwa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_38, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5367, position: 4, content: "Uuyuni mbu nda kala mo\nItau ka ka kala po.\nEgumbo muka ndi li mo,\nOta hulu po;\nOta hulu po.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_38, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5368, position: 5, content: "Omukulili omuholike,\nUunake oto ya,\nU ile ndje, kungoy’ ndi ye\nMegumbo ndyo lya pwa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_38, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5369, position: 6, content: "Megulu tii kala mo,\nMegumbo ewanawa.\nMahodhi nde ga thetwa po,\nOngoy’ nda nyanyunkwa,\nOngoy’ nda nyanyukwa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_38, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5370, position: 1, content: "Kalunga ketu, tu li mpa.\nAamwoye tse tu zimina.\nOtatu ku galikana,\nTu yambeka niipalutha.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_39, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5371, position: 2, content: "Ligandhi yoye matula,\nYi n’iilya kayi yelekwa.\nOmapya getu menitha,\nNiimenno yago yambeka.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_39, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5372, position: 3, content: "Ongoye ngu ho palutha\nShaa shoka mwenyo shi gu na.\nOnkugo yuudhilona wo\nHo uvu, uv’ aamwoye wo.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_39, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5373, position: 4, content: "Tu kwatha, oondjo tu dhi na,\nOomwenyo dhetu yapula.\nOhenda u tu sile mpa,\nMegulu lyoye nyanyudha.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_39, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5374, position: 1, content: "Mufilishish’ omuholike,\nMhumbwe detu ho tu pe.\nLutu ho p’oipalwifa,\nMweenyo eendjovo doy’tu pa.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_40, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5375, position: 2, content: "Kwoove ou wa fimana,\nNdaka hatu yelula,\nTuku hambelelele\nShalinghenda shoye nee.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_40, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5376, position: 1, content: "Ye ine uya okutokola,\nTu ye mekaneno.\nOkwe uya kuxupifa,\nA xupife, nge yoo.\nA ifanwa Omkulili.\nA ifanwa Omkulili.\nOlo edina la yuka,\nShaashi e tu kulila.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_41, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5377, position: 1, content: "Nge te uya nge te uya;\nTa il’ eemba daye,\nMona laye, e li twale\nMeulu puye.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_42, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5378, content: "Ngaashi eenyofi keulu, Osho\neemba da Jeus Tadi toka\nmomuyumbo Meulu kye.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_42, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5379, position: 2, content: "Ye ta ile, ye ta ile\nOumb’ aveshe vaye,\nAva vawa, va wapala\nMeulu puye.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_42, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5380, position: 3, content: "Nye ounona, nye ounona,\nOny’ eemba da Jesus!\nShaa mwe mu hala,\nTam’ ka kala Meulu puye.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_42, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5381, position: 1, content: "Tate, otwe uya,\nFye twa ongala\nNena yo, mefiku loye,\nOkuud’eendjovo doye.\nHatu ku indile,\nU tu popife.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_43, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5382, position: 2, content: "Okomulaulu fye\nTwa li eehepele,\nTwa fa eed’ edi da kana,\nNdee Omufita wetu nana,\nWe tu shila mo\nOmekaneno", hymnsNumber: KwHymnsNumberSeeder.GENERAL_43, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5383, position: 3, content: "Nomoulunde yo\nU tu shile mo\nHatu kong’onghenda yoye,\nU tu ning’ovanhu voye,\nU tu tambule,\nTu ku kalele.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_43, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5384, position: 4, content: "Tu p’ouyelele,\nU tu yelele,\nFye tu end’ondjila yoye,\nNatu long’ehalo loye,\nTu ku shikule\nNena naalushe.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_43, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5385, position: 1, content: "Kesh’ apa ye ta twala nge,\nNda hala oku mu shikula.\nOmukulili a fila nge\nEfyo lidjuu kuGolgata", hymnsNumber: KwHymnsNumberSeeder.GENERAL_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5386, content: "Nda hala shili ndi ha ndje\nPonho yOmufita ou muwa,\nE hole nge, a fila nge\nEfyo lidjuu kuGolgata.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_44, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 5387, position: 2, content: "Hand’ende nokunyakukwa,\nNda hafa, ndi nOmukulili.\nNda hala y’okudulika\nKehalo lay’ liyapuki.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5388, position: 3, content: "Henno, Omwene, kwafe nge,\nAlushe ndi ku shikule,\nMuove hai lineekele,\nKaume, ou ito efa nge.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_44, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 5389, position: 1, content: "Kehe ngula ohend’ompe,\nTu s’iimpwiyu yashike?\nUupyu wa yi nuuhepele,\nTu n’ohenda ayike.\nHambeleleni Omuwa gwetu!\nJesus mwene nonena ku li mpa\nKwe tu hokwa nokwe tu pa\nMbili puye kaandjetu.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5390, position: 2, content: "Kehe ngula ohend’ompe!\nNe mu tidje p’uumbanda,\nOnohenda ta geele ndje,\nOnohenda ta ganda.\nHenda ngele te tu p’oyindji,\nOmegulu ote tu falele,\nHenda shaa tayi koleke,\nTu n’eitaalo olindji.", hymnsNumber: KwHymnsNumberSeeder.GENERAL_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 5391, position: 3, content: "Mbo haa lili, kaa lile we,\nNgaashi oohondji ndho dhaa po\nMbo haa yolo, yaa ligole,\nOngondigolo yaa po.\nEyo lyOmuwa popepi li li.\nTu li tegeni, twe li yuulukwa!\nImbileni Onzigona!\nYe Omusindani shili!", hymnsNumber: KwHymnsNumberSeeder.GENERAL_45, typeStanza: HymnsContentCode.VERSE),
  ];
}